import { IonApp, IonRouterOutlet, IonSplitPane } from '@ionic/react';
import { IonReactRouter } from '@ionic/react-router';
import { Redirect, Route } from 'react-router-dom';
import Menu from './components/Menu/Menu';

/* Core CSS required for Ionic components to work properly */
import '@ionic/react/css/core.css';

/* Basic CSS for apps built with Ionic */
import '@ionic/react/css/normalize.css';
import '@ionic/react/css/structure.css';
import '@ionic/react/css/typography.css';

/* Optional CSS utils that can be commented out */
import '@ionic/react/css/padding.css';
import '@ionic/react/css/float-elements.css';
import '@ionic/react/css/text-alignment.css';
import '@ionic/react/css/text-transformation.css';
import '@ionic/react/css/flex-utils.css';
import '@ionic/react/css/display.css';

/* Theme variables */
import './theme/variables.css';

import Dashboard from "./pages/Dashboard/Dashboard";
import Agents from "./pages/Agents/Agents";
import Complexes from "./pages/Complexes/Complexes";
import Packages from "./pages/Packages/Packages";
import Promotions from "./pages/Promotions/Promotions";
import SignIn from "./pages/SignIn/SignIn";
import SignUp from "./pages/SignUp/SignUp";
import Calendar from "./pages/Calendar/Calendar";
import Profile from "./pages/Profile/Profile";
import AddAgent from "./pages/Agents/AddAgent/AddAgent"
import CardDetails from "./components/CardDetails/CardDetails";

import Router from './pages/Router';

const App: React.FC = () => {
  return (
    <IonApp>
      <IonReactRouter>
        <IonSplitPane contentId="main">
          <Menu />
          <IonRouterOutlet id="main">
    <Route path="/" exact={true}>
      <Redirect to="/signIn" />
    </Route>
    <Route path="/dashboard" exact={true}>
      <Dashboard />
    </Route>
    <Route path="/calendar" exact={true}>
      <Calendar />
    </Route>
    <Route path="/agent" exact={true}>
      <Agents />
    </Route>
    <Route path="/cardDetails/:name/:type" exact={true}>
      <CardDetails />
      </Route>
      <Route path="/addAgent" exact={true}>
      <AddAgent />
    </Route>
    <Route path="/complex" exact={true}>
      <Complexes />
    </Route>
    <Route path="/package" exact={true}>
      <Packages />
    </Route>
    <Route path="/promotion" exact={true}>
      <Promotions />
    </Route>
    <Route path="/profile" exact={true}>
      <Profile />
    </Route>
    <Route path="/signIn" exact={true}>
      <SignIn />
    </Route>
    <Route path="/signUp" exact={true}>
      <SignUp />
    </Route>
  </IonRouterOutlet>
        </IonSplitPane>
      </IonReactRouter>
    </IonApp>
  );
};

export default App;
